import React from 'react';

import { Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  return (
    <div className="App container-fluid">
      <Row>
        <Col className="bg-danger p-5" md={3}>
          <h4>Chazzy</h4>
        </Col>
        <Col className="bg-light p-5 heightFull align-items-center" md={4}>
          <h4>Chazzy</h4>
        </Col>
      </Row>
    </div>
  );
}

export default App;
